INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 0, 1, "キャル", 106001, 1, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 7001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 0, 1, "コッコロ", 105901, 1, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 7002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 0, 1, "ペコリーヌ", 105801, 1, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 7003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 0, 1, "ペコリーヌ", 105801, 1, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 10001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 0, 1, "キャル", 106001, 1, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 10002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 0, 1, "コッコロ", 105901, 1, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 10003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 0, 1, "シェフィ", 106401, 1, 2, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 10004, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (12, 0, 1, "ペコリーヌ", 105801, 1, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 12001, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13, 0, 1, "キャル", 106001, 1, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 13001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13, 0, 1, "コッコロ", 105901, 1, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 13002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13, 0, 1, "シェフィ", 106401, 1, 2, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 13003, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13, 0, 1, "ペコリーヌ", 105801, 1, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 13004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14, 0, 1, "コッコロ", 105901, 1, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 14001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14, 0, 1, "シェフィ", 106401, 1, 2, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 14002, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14, 0, 1, "ペコリーヌ", 105801, 1, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 14003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14, 0, 1, "キャル", 106001, 1, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 14004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (15, 0, 1, "コッコロ", 105901, 1, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 15001, 0, 0.0, "2030/12/17 14:59:59", -470.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16, 0, 1, "シェフィ", 106401, 1, 2, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 16001, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16, 0, 1, "ペコリーヌ", 105801, 1, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 16002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16, 0, 1, "キャル", 106001, 1, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 16003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16, 0, 1, "コッコロ", 105901, 1, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 16004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17, 0, 1, "コッコロ", 105901, 1, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 17002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (25, 0, 1, "キャル", 106001, 1, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 17004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (25, 0, 1, "コッコロ", 105901, 1, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 17005, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (25, 0, 1, "シェフィ", 106401, 1, 2, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 17006, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (25, 0, 1, "ペコリーヌ", 105801, 1, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 17007, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (18, 0, 1, "カリン", 190801, 1, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 18001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (18, 0, 1, "カリン", 190801, 2, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 18002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (19, 0, 1, "カリン", 190801, 3, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 19001, 0, 0.0, "2030/12/17 14:59:59", -470.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (19, 0, 1, "カリン", 190801, 4, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 19002, 0, 0.0, "2030/12/17 14:59:59", -470.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (20, 0, 1, "カリン", 190801, 5, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 20001, 0, 0.0, "2030/12/17 14:59:59", -470.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (20, 0, 1, "カリン", 190801, 6, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 20002, 0, 0.0, "2030/12/17 14:59:59", -470.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21, 0, 1, "キャル", 106001, 1, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 21001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21, 0, 1, "コッコロ", 105901, 1, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 21002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21, 0, 1, "シェフィ", 106401, 1, 2, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 21003, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21, 0, 1, "ペコリーヌ", 105801, 1, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 21004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (22, 0, 1, "カリン", 190801, 1, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 22001, 0, 0.0, "2030/12/17 14:59:59", -430.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (22, 0, 1, "カリン", 190801, 2, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 22002, 0, 0.0, "2030/12/17 14:59:59", -430.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (23, 0, 1, "カリン", 190801, 3, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 23001, 0, 0.0, "2030/12/17 14:59:59", -430.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (23, 0, 1, "カリン", 190801, 4, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 23002, 0, 0.0, "2030/12/17 14:59:59", -430.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "エリコ（バレンタイン）", 109001, 1, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, 24001, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "エリコ（バレンタイン）", 109001, 2, 1, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, 24002, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "エリコ（バレンタイン）", 109001, 3, 1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, 24003, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "エリコ（バレンタイン）", 109001, 4, 1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, 24004, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "エリコ（バレンタイン）", 109001, 5, 1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, 24005, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "エリコ（バレンタイン）", 109002, 6, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 24006, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "エリコ（バレンタイン）", 109002, 7, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 24007, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "エリコ（バレンタイン）", 109002, 8, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 24008, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "エリコ（バレンタイン）", 109002, 9, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 24009, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "エリコ（バレンタイン）", 109002, 10, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 24010, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "シズル（バレンタイン）", 109101, 1, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2.12, 24011, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "シズル（バレンタイン）", 109101, 2, 5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 4.19, 24012, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 4, "シズル（バレンタイン）", 109101, 3, 2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2.3, 24013, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "シズル（バレンタイン）", 109102, 4, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 24014, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "シズル（バレンタイン）", 109101, 5, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5.23, 24015, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "シズル（バレンタイン）", 109102, 6, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 24016, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 2, "シズル（バレンタイン）", 109101, 7, 1, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 5.01, 24017, 0, 8.0, "2030/12/17 14:59:59", -385.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "シズル（バレンタイン）", 109102, 8, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 24018, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "シズル（バレンタイン）", 109102, 9, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 24019, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24, 10011, 1, "シズル（バレンタイン）", 109102, 10, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 24020, 0, 0.0, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26, 0, 1, "シェフィ", 106401, 1, 2, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, 26001, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26, 0, 1, "ペコリーヌ", 105801, 1, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0.0, 26002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26, 0, 1, "キャル", 106001, 1, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, 26003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26, 0, 1, "コッコロ", 105901, 1, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, 26004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27, 0, 1, "シェフィ", 106401, 1, 2, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0.0, 27001, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27, 0, 1, "ペコリーヌ", 105801, 1, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0.0, 27002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27, 0, 1, "キャル", 106001, 1, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0.0, 27003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27, 0, 1, "コッコロ", 105901, 1, 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0.0, 27004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (28, 0, 1, "カリン", 190801, 1, 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0.0, 28001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (28, 0, 1, "カリン", 190801, 2, 1, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 0.0, 28002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (29, 0, 1, "カリン", 190801, 3, 1, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 0.0, 29001, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (29, 0, 1, "カリン", 190801, 4, 1, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0.0, 29002, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (30, 0, 1, "カリン", 190801, 5, 1, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0.0, 30001, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (30, 0, 1, "カリン", 190801, 6, 1, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0.0, 30002, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (31, 0, 1, "カリン", 190801, 7, 1, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0.0, 31001, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (31, 0, 1, "カリン", 190801, 8, 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0.0, 31002, 0, 0.0, "2030/12/17 14:59:59", -409.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (32, 0, 1, "カリン", 190801, 1, 1, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0.0, 32001, 0, 0.0, "2020/01/04 4:59:59", -409.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (32, 0, 1, "カリン", 190801, 2, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 32002, 0, 0.0, "2020/01/04 4:59:59", -409.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (33, 0, 1, "カリン", 190801, 3, 1, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0.0, 33001, 0, 0.0, "2020/01/04 4:59:59", -409.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (33, 0, 1, "カリン", 190801, 4, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 33002, 0, 0.0, "2020/01/04 4:59:59", -409.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (34, 0, 1, "カリン", 190801, 5, 1, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0.0, 34001, 0, 0.0, "2020/01/10 11:59:59", -409.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (34, 0, 1, "カリン", 190801, 6, 1, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0.0, 34002, 0, 0.0, "2020/01/10 11:59:59", -409.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (38, 0, 2, "ペコリーヌ", 105801, 1, 1, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 5.3, 38001, 0, 0.0, "2030/12/17 14:59:59", -458.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (38, 0, 2, "ペコリーヌ", 105801, 2, 1, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 6.5, 38002, 0, 0.0, "2030/12/17 14:59:59", -458.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (39, 0, 3, "ペコリーヌ", 105801, 0, 3, "", 0.0, 39005, 0, 9999.0, "2020/04/08 23:59:59", 9999.0, "2020/04/01");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (40, 0, 1, "カリン", 190801, 2, 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0.0, 40001, 0, 0.0, "2030/12/17 14:59:59", -430.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41, 0, 1, "シェフィ", 106401, 1, 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 0.0, 41001, 2104010, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41, 0, 1, "ペコリーヌ", 105801, 1, 1, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0.0, 41002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41, 0, 1, "キャル", 106001, 1, 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0.0, 41003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41, 0, 1, "コッコロ", 105901, 1, 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0.0, 41004, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42, 0, 1, "コッコロ", 105901, 1, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0.0, 42001, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42, 0, 1, "シェフィ", 106401, 1, 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 0.0, 42002, 2104010, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42, 0, 1, "ペコリーヌ", 105801, 1, 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0.0, 42003, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42, 0, 1, "キャル", 106001, 1, 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0.0, 42004, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43, 0, 1, "ペコリーヌ", 105801, 1, 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0.0, 43001, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43, 0, 1, "コッコロ", 105901, 1, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0.0, 43002, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43, 0, 1, "キャル", 106001, 1, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0.0, 43003, 0, 0.0, "2030/12/17 14:59:59", -363.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (44, 0, 1, "アメス", 123001, 1, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0.0, 43004, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (44, 0, 1, "アメス", 123001, 2, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0.0, 43005, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (45, 0, 2, "アメス", 123001, 3, 1, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 5.79, 43006, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (46, 0, 1, "アメス", 123001, 1, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0.0, 46001, 0, 0.0, "2030/12/17 14:59:59", -371.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (47, 0, 2, "シズル", 104901, 1, 2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0.0, 47001, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (47, 0, 2, "リノ", 101101, 1, 1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 9.32, 47002, 0, 0.0, "2030/12/17 14:59:59", -416.5, "2015/12/17 15:00:00");
